import Dashboard from "views/Dashboard.js";
import Notifications from "views/Notifications.js";
import Icons from "views/Icons.js";
import Typography from "views/Typography.js";
import TableList from "views/Tables.js";
import UserPage from "views/User.js";
import UpgradeToPro from "views/Upgrade.js";
import ManageCoursePage from "views/ManageCoursePage.js";
import BatchManager from "views/BatchManager.js";
import Courses from "views/Courses";
import Liveclass from "views/Liveclass";
import QandA from "views/QandA";

var dashboardComponent = <Dashboard />;
var iconsComponent = <Icons />;
var notificationsComponent = <Notifications />;
var userPageComponent = <UserPage />;
var manageCoursePageComponent = <ManageCoursePage />;
var batchManagerComponent = <BatchManager />;
var tableListComponent = <TableList />;
var typographyComponent = <Typography />;
var upgradeToProComponent = <UpgradeToPro />;
var coursesComponent = <Courses />;
var liveclassComponent = <Liveclass />;
var qandaComponent = <QandA />;

var routes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "nc-icon nc-chart-bar-32",
    component: dashboardComponent,
    layout: "/admin",
  },
  {
    path: "/Icons",
    name: "Manage Student",
    icon: "nc-icon nc-single-02",
    component: iconsComponent,
    layout: "/admin",
  },
  {
    path: "/notifications",
    name: "Manage Faculties",
    icon: "nc-icon nc-hat-3",
    component: notificationsComponent,
    layout: "/admin",
  },
  {
    path: "/user-page",
    name: "Profile",
    icon: "nc-icon nc-bookmark-2",
    component: userPageComponent,
    layout: "/admin",
  },
  {
    path: "/ManageCoursePage",
    name: "Manage Course",
    icon: "nc-icon nc-book-bookmark",
    component: manageCoursePageComponent,
    layout: "/admin",
  },
  {
    path: "/BatchManager",
    name: "Batch Manage",
    icon: "nc-icon nc-watch-time",
    component: batchManagerComponent,
    layout: "/admin",
  },
  {
    path: "/tables",
    name: "Manage Schedule",
    icon: "nc-icon nc-calendar-60",
    component: tableListComponent,
    layout: "/admin",
  },
  {
    path: "/typography",
    name: "Manage Exam",
    icon: "nc-icon nc-ruler-pencil",
    component: typographyComponent,
    layout: "/admin",
  },
  {
    path: "/Courses",
    name: "My Courses",
    icon: "nc-icon nc-single-copy-04",
    component: coursesComponent,
    layout: "/admin",
  },
  
  {
    path: "/QandA",
    name: "Question and Answer",
    icon: "nc-icon nc-bullet-list-67",
    component: qandaComponent,
    layout: "/admin",
  },
  {
    divider: true
  },
  {
    divider: true
  },
  // Add an empty object to create a gap
  
  {
    pro: true,
    path: "/upgrade",
    name: "Manage Certification",
    icon: "nc-icon nc-trophy",
    component: upgradeToProComponent,
    layout: "/admin",
  },
  
  {
    path: "/Liveclass",
    name: "My Classes",
    icon: "nc-icon nc-time-alarm",
    component: liveclassComponent,
    layout: "/admin",
  },
];

export default routes;
